import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AuthenticationComponent } from './shared/components/authentication/authentication.component';
import { DashboardComponent } from './admin/components/dashboard/dashboard.component';
import { CrearproyectoComponent } from './admin/components/crearproyecto/crearproyecto.component';
import { ListarproyectosComponent } from './admin/components/listarproyectos/listarproyectos.component';
import { EditarproyectoComponent } from './admin/components/editarproyecto/editarproyecto.component';
import { VerproyectoComponent } from './admin/components/verproyecto/verproyecto.component';
import { AuthGuard } from './shared/helpers/auth.guard';

const routes: Routes = [
  {path: "login", component:AuthenticationComponent, pathMatch: 'full'},
  {path: "dashboard", component:DashboardComponent,canActivate:[AuthGuard] , children:[
    {path:'verproyecto/:id',component: VerproyectoComponent},
    {path:'listaproyectos',component: ListarproyectosComponent},
    {path:'editarproyecto/:id',component: EditarproyectoComponent},
    {path:'crearproyecto',component: CrearproyectoComponent}
  ], pathMatch: 'full'}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
